import logo from './logo.svg';
import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';
import { createBrowserRouter, RouterProvider, useNavigate, useParams,Link } from 'react-router-dom';


const products = [
    { title: "Potato", isFruit: false, id: 1 },
    { title: "Garlic", isFruit: false, id: 2 },
    { title: "Apple", isFruit: true, id: 3 },
];

function ProductList() {
    const navigate = useNavigate();

    const choosenproduct = (id)=> {
        navigate(`/product/${id}`);
    };

    return (
        <div>
            <h1>Product List</h1>
            <table>
                <thead>
                    <tr>
                        <th>Title</th>

                    </tr>
                </thead>
                <tbody>
                    {products.map(product => (
                        <tr key={product.id}>
                            <td>{product.title}</td>
                            <td>
                                <button onClick={() => choosenproduct(product.id)}>View Details</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

// Product Detail Component
function ProductDetail() {
    const { id } = useParams();
    const product = products.find(p => p.id === parseInt(id));


    return (
        <div>
            <h2>Product Details</h2>
            <p>Title: {product.title}</p>
            <p>ID: {product.id}</p>
            <p>Is Fruit: {product.isFruit ? "Yes" : "No"}</p>
        <Link to="/">Go to Product List</Link>
        </div>
    );
}



const router = createBrowserRouter([
    {
        path: "/",
        element: <ProductList />,
    },
    {
        path: "/product/:id",
        element: <ProductDetail />,
    },
]);

function App() {
    return (
        <RouterProvider router={router} />
    );
}

// Render the App
ReactDOM.render(<App />, document.getElementById('root'));

export default App;
